    // I'm not going to bother fully documenting this class because it's only used by AudioEndpointManager.ListAllEndpoints(), which isn't
    // even used by the main application. I used that method and this class to collect information about audio devices to determine which
    // properties to include in the AudioEndpointInfo class. It isn't really needed anymore, but is handy for outputting nerdy device info.

    // The TL;DR is if you call Lookup(guid, id), it will return a PropertyKeyDef struct containing the name of that property key, if that
    // property key's name is known by being listed in the Windows SDK. (Only audio endpoint and some device related properties are included
    // in the table.) There are still a ton of unknown audio related property keys, but I've exhausted my options and patience looking for them.
    class PropertyKeyDefLookup
    {
        public enum PropertyKeyDefType
        {
            PKEY,
            DEVPKEY,
        }

        public struct PropertyKeyDef(PropertyKeyDefType type, string name, Guid guid, int id)
        {
            public PropertyKeyDefType Type = type;
            public string Name = name;
            public Guid Guid = guid;
            public int Id = id;
        }

        public static PropertyKeyDef? Lookup(Guid guid, int id)
        {
            // First attempt to find matching property key of type DEVPKEY
            var propertyKeyDef = PropertyKeyDefs.FirstOrDefault(def => def.Type == PropertyKeyDefType.DEVPKEY && def.Guid == guid && def.Id == id);
            if (!propertyKeyDef.Equals(default(PropertyKeyDef)))
            {
                // Match found
                return propertyKeyDef;
            }
            // If not found, attempt to find matching property key of type PKEY
            propertyKeyDef = PropertyKeyDefs.FirstOrDefault(def => def.Type == PropertyKeyDefType.PKEY && def.Guid == guid && def.Id == id);
            if (!propertyKeyDef.Equals(default(PropertyKeyDef)))
            {
                // Match found
                return propertyKeyDef;
            }
            return null;
        }

        public static PropertyKeyDef? Lookup(string name)
        {
            // First attempt to find matching property key of type DEVPKEY
            var propertyKeyDef = PropertyKeyDefs.FirstOrDefault(def => def.Type == PropertyKeyDefType.DEVPKEY && def.Name == name);
            if (!propertyKeyDef.Equals(default(PropertyKeyDef)))
            {
                // Match found
                return propertyKeyDef;
            }
            // If not found, attempt to find matching property key of type PKEY
            propertyKeyDef = PropertyKeyDefs.FirstOrDefault(def => def.Type == PropertyKeyDefType.PKEY && def.Name == name);
            if (!propertyKeyDef.Equals(default(PropertyKeyDef)))
            {
                // Match found
                return propertyKeyDef;
            }
            return null;
        }
        
