/*
To convert from .h "DEFINE"s to "new PropertyKeyDef"s using Notepad++ regex replace:
(DEFINE_DEVPROPKEY|DEFINE_PROPERTYKEY)\((DEVPKEY|PKEY)_(\w+), +(0x[0-f]+, +0x[0-f]+, +0x[0-f]+, +0x[0-f]+, +0x[0-f]+, +0x[0-f]+, +0x[0-f]+, +0x[0-f]+, +0x[0-f]+, +0x[0-f]+, +0x[0-f]+), (\d+)\);
replace with
            new\(PropertyKeyDefType.${2}, "${3}", new Guid\(${4}\), ${5}\),

// https://www.magnumdb.com/search also has some, but nothing particularly useful to me.
*/